import React from 'react';
import './App.css';
import { FaGithub, FaTwitter, FaReact } from "react-icons/fa";

function App() {
  return (
    <div className="App">
      <h1>Tennis Tweets  <FaTwitter /></h1> 
      <h2> What is it? </h2>
    </div>
  );
}

export default App;
